import { createStore } from "vuex";

const store = createStore({
  state: {
    tempData: [],
    ph: [],
    tak: [],
    DO: [],
  },
  mutations: {
    updateData(state, payload) {
      state.tempData = payload.tempData;
      state.ph = payload.ph;
      state.tak = payload.tak;
      state.DO = payload.DO;
    },
  },
});
